import React from 'react';
import Counter, {counterProps} from '../hoc/Counter/counter';

const Increment: React.FC<counterProps> = (props: counterProps) => {
    // const {count, incrementCount, decrementCount} = props;

    return <React.Fragment>
        <button onClick={props.incrementCount}>+</button>
        <button onClick={props.decrementCount}>-</button>
        <span>The count is {props.count}</span>
    </React.Fragment>
};

export default Counter(Increment);
